/**
 * Determines axis iteration algorithm.
 *
 * @param axisNumber
 * 		element from {@code AxisInfo}
 * @param nodeTest
 * 		filter for iterator
 * @return {@code AxisIterator} object
 */
@Override
public AxisIterator iterateAxis(int axisNumber, NodePredicate nodeTest) {
    AxisIterator axisIterator = iterateAxis(axisNumber);
    if (nodeTest != null) {
        axisIterator = new Navigator.AxisFilter(axisIterator, nodeTest);
    }
    return axisIterator;
}

/**
 * Determines axis iteration algorithm. Throws {@code UnsupportedOperationException} in case,
 * when there is no axis iterator for given axisNumber.
 *
 * @param axisNumber
 * 		element from {@code AxisInfo}
 * @return {@code AxisIterator} object
 */
@Override
public AxisIterator iterateAxis(int axisNumber) {
    return switch (axisNumber) {
        case AxisInfo.ANCESTOR, AxisInfo.PARENT, AxisInfo.FOLLOWING, AxisInfo.FOLLOWING_SIBLING, AxisInfo.PRECEDING, AxisInfo.PRECEDING_SIBLING ->
            EmptyIterator.ofNodes();
        case AxisInfo.ANCESTOR_OR_SELF, AxisInfo.SELF ->
            SingleNodeIterator.makeIterator(this);
        case AxisInfo.CHILD ->
            {
                if (hasChildNodes()) {
                    yield new ArrayIterator.OfNodes<>(getChildren().toArray(EMPTY_ABSTRACT_NODE_ARRAY));
                }
                yield EmptyIterator.ofNodes();
            }
        case AxisInfo.DESCENDANT ->
            {
                if (hasChildNodes()) {
                    yield new DescendantIterator(this, DescendantIterator.StartWith.CHILDREN);
                }
                yield EmptyIterator.ofNodes();
            }
        case AxisInfo.DESCENDANT_OR_SELF ->
            new DescendantIterator(this, DescendantIterator.StartWith.CURRENT_NODE);
        default ->
            throw throwUnsupportedOperationException();
    };
}

