 * Initializes this DetailAstImpl.
 *
 * @param token
 * 		the token to generate this DetailAstImpl from
 */
public void initialize(Token token) {
    text = token.getText();
    type = token.getType();
    lineNo = token.getLine();
    columnNo = token.getCharPositionInLine();
}

/**
 * Appends comment nodes to existing AST.
 * It traverses each node in AST, looks for hidden comment tokens
 * and appends found comment tokens as nodes in AST.
 *
 * @param root
 * 		of AST
 * @return root of AST with comment nodes
 */
public static DetailAST appendHiddenCommentNodes(DetailAST root) {
    DetailAST curNode = root;
    DetailAST lastNode = root;
    while (curNode != null) {
        lastNode = curNode;
        final List<Token> hiddenBefore = ((DetailAstImpl) (curNode)).getHiddenBefore();
        if (hiddenBefore != null) {
            DetailAST currentSibling = curNode;
            final ListIterator<Token> reverseCommentsIterator = hiddenBefore.listIterator(hiddenBefore.size());
            while (reverseCommentsIterator.hasPrevious()) {
                final DetailAST newCommentNode = createCommentAstFromToken(((CommonToken) (reverseCommentsIterator.previous())));
                ((DetailAstImpl) (currentSibling)).addPreviousSibling(newCommentNode);
                currentSibling = newCommentNode;
            } 
        }
        DetailAST toVisit = curNode.getFirstChild();
        while ((curNode != null) && (toVisit == null)) {
            toVisit = curNode.getNextSibling();
            curNode = curNode.getParent();
        } 
        curNode = toVisit;
    } 
    if (lastNode != null) {
        final List<Token> hiddenAfter = ((DetailAstImpl) (lastNode)).getHiddenAfter();
        if (hiddenAfter != null) {
            DetailAST currentSibling = lastNode;
            for (Token token : hiddenAfter) {
                final DetailAST newCommentNode = createCommentAstFromToken(((CommonToken) (token)));
                ((DetailAstImpl) (currentSibling)).addNextSibling(newCommentNode);
                currentSibling = newCommentNode;
            }
        }
    }
    return root;
}

/**
 * Finds unclosed tag name tokens by comparing open and close tag name tokens.
 *
 * <p>
 * This method attempts to match each closing tag with the most recent
 * unmatched opening tag of the same name, considering only tags that appear
 * before it in the token stream. Any remaining unmatched opening tags are
 * considered unclosed and returned.
 * </p>
 *
 * <p>
 * <b>Note:</b> This method must be called after lexing is complete to ensure
 * that all tokens have their index values set.
 * </p>
 *
 * @param openTagNameTokens
 * 		a deque of {@link Token} instances representing open tag names
 * @param closeTagNameTokens
 * 		a deque of {@link Token} instances representing close tag names
 * @return a set of {@link SimpleToken} instances representing unclosed tag names
 */
public static Set<SimpleToken> getUnclosedTagNameTokens(Deque<Token> openTagNameTokens, Deque<Token> closeTagNameTokens) {
    final Deque<Token> unmatchedOpen = new ArrayDeque<>(openTagNameTokens);
    for (Token closingTag : closeTagNameTokens) {
        final Deque<Token> tempStack = new ArrayDeque<>();
        while (!unmatchedOpen.isEmpty()) {
            final Token openingTag = unmatchedOpen.pop();
            if (openingTag.getText().equalsIgnoreCase(closingTag.getText()) && (openingTag.getTokenIndex() < closingTag.getTokenIndex())) {
                break;
            }
            tempStack.push(openingTag);
        } 
        // Put unmatched tags back
        while (!tempStack.isEmpty()) {
            unmatchedOpen.push(tempStack.pop());
        } 
    }
    // We cannot map to SimpleToken until lexing has completed, otherwise
    // the token index will not be set.
    return unmatchedOpen.stream().map(SimpleToken::from).collect(Collectors.toUnmodifiableSet());
}

