@Override
public void syntaxError(Recognizer<?, ?> recognizer, Object offendingSymbol, int line, int charPositionInLine, String msg, RecognitionException ex) {
    final int lineNumber = offset + line;
    final String target;
    if (recognizer instanceof JavadocCommentsLexer lexer) {
        target = lexer.getPreviousToken().getText();
    } else {
        final int ruleIndex = ex.getCtx().getRuleIndex();
        final String ruleName = recognizer.getRuleNames()[ruleIndex];
        target = convertUpperCamelToUpperUnderscore(ruleName);
    }
    errorMessage = new ParseErrorMessage(lineNumber, MSG_JAVADOC_PARSE_RULE_ERROR, charPositionInLine, msg, target);
}
